import ProductCard from "./ProductCard";


export default function ProductList({products}) {

    const rows = [];

    products.forEach((product) => {
        rows.push(
            <ProductCard product={product} key={product.id}/>
        );
    });

    return (
        <div className="col-md-9 row">
            {rows}
        </div>
    );
}
